<div class="modal fade image-picker-modal" id="imagePickerModal" tabindex="-1">
    <div class="modal-dialog">
        <div class="modal-content">
            <div class="modal-header">
                <h5 class="modal-title">
                    <i class="fas fa-images me-2"></i>
                    Chọn Ảnh Từ Thư Viện
                </h5>
                <button type="button" class="bootstrap btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
            </div>

            <div class="modal-body">
                <div class="modal-search-section">
                    <div class="search-input-wrapper">
                        <i class="fas fa-search"></i>
                        <input type="text" class="form-control" id="modalSearchInput" placeholder="Tìm kiếm ảnh theo tên..." oninput="searchModalImages()">
                    </div>
                </div>

                <div class="upload-section">
                    <div class="upload-drop-zone">
                        <div class="upload-icon">
                            <i class="fas fa-cloud-upload-alt"></i>
                        </div>
                        <h5>Kéo & Thả Nhiều Ảnh Vào Đây</h5>
                        <p class="text-muted">hoặc nhấn nút bên dưới để chọn nhiều ảnh</p>
                        <label for="multipleImageInput" class="btn btn-upload">
                            <i class="fas fa-folder-open me-2"></i>
                            Chọn Nhiều Ảnh
                        </label>
                        <input type="file" id="multipleImageInput" accept="image/*" multiple class="d-none">
                        <small class="text-muted d-block mt-3">
                            Hỗ trợ: JPG, PNG, GIF, WebP (Tối đa 5MB mỗi ảnh)
                        </small>
                    </div>
                </div>

                <div class="gallery-section d-block" id="gallerySection">
                    <div class="gallery-header">
                        <h5>
                            <i class="fas fa-images me-2"></i>
                            Thư Viện Ảnh (<span id="imageCount">0</span>)
                        </h5>
                        <button class="btn btn-outline-danger bootstrap" onclick="clearAllImages()">
                            <i class="fas fa-trash-alt me-1"></i>
                            Xóa Tất Cả
                        </button>
                    </div>
                    <div class="image-grid" id="imageGrid">
                        <div class="image-card">
                            <div class="image-wrapper">
                                <img src="data:image/png;base64," alt="17985542.png">
                                <div class="image-overlay">
                                    <div class="image-actions">
                                        <button class="action-btn view-btn" onclick="viewImageDetail('1760598601923.9207')" title="Xem chi tiết">
                                            <i class="fas fa-eye"></i>
                                        </button>
                                        <button class="action-btn download-btn" onclick="downloadImage('1760598601923.9207')" title="Tải xuống">
                                            <i class="fas fa-download"></i>
                                        </button>
                                        <button class="action-btn delete-btn" onclick="deleteImage('1760598601923.9207')" title="Xóa">
                                            <i class="fas fa-trash-alt"></i>
                                        </button>
                                    </div>
                                </div>
                            </div>
                            <div class="image-info-section">
                                <div class="image-name" title="17985542.png">17985542.png</div>
                                <div class="image-meta">
                                    <span>56.35 KB</span>
                                    <span>512 x 512</span>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>

            <div class="modal fade detail-modal-image" id="imageDetailModal" tabindex="-1">
                <div class="modal-dialog modal-dialog-centered">
                    <div class="modal-content">
                        <div class="modal-header">
                            <h5 class="modal-title">
                                <i class="fas fa-info-circle me-2"></i>
                                Chi Tiết Ảnh
                            </h5>
                            <button type="button" class="btn-close" data-bs-dismiss="modal"></button>
                        </div>
                        <div class="modal-body">
                            <img id="detailImage" src="/placeholder.svg" alt="Detail" class="detail-image">
                            <div class="detail-info">
                                <div class="detail-row">
                                    <strong><i class="fas fa-file-signature me-2"></i>Tên file:</strong>
                                    <span id="detailFileName">-</span>
                                </div>
                                <div class="detail-row">
                                    <strong><i class="fas fa-weight me-2"></i>Kích thước file:</strong>
                                    <span id="detailFileSize">-</span>
                                </div>
                            </div>
                        </div>
                        <div class="modal-footer">
                            <button type="button" class="btn btn-success" onclick="downloadFromModal()">
                                <i class="fas fa-download me-2"></i>
                                Tải Xuống
                            </button>
                            <button type="button" class="btn btn-secondary" data-bs-dismiss="modal">
                                Đóng
                            </button>
                        </div>
                    </div>
                </div>
            </div>

            <div class="modal-footer">
                <button type="button" class="btn btn-secondary bootstrap" data-bs-dismiss="modal">Cancel</button>
                <button type="button" class="btn btn-success bootstrap" data-bs-dismiss="modal">Temp</button>
            </div>
        </div>
    </div>
</div>
